import React from 'react';
import Tag from '../../utils/tags';

import './tags.styles.css';

const Tags = () => (
  <div className='tag-container'>
    {
      Tag.map(item => (
        <span>{ item }</span>
      ))
    }
  </div>
);

export default Tags;
